import React, { Component } from 'react';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';
import TopBar from "./components/TopBar"
import FirstBlock from "./components/FirstBlock"
import "./styles/style.css"
import JS from "./images/JS.svg"
import RCT from "./images/react.svg"
import CSHARP from "./images/CSharp.svg"
import DOTNET from "./images/dotnet.svg"
import HTML5 from "./images/html-5.svg"
import CSS3 from "./images/css-3.svg"

class Home extends Component {



    render() {

        return (
            <>
                <TopBar />
                <ParallaxBanner className="technologies" layers={[
                    {
                        image: 'https://foo.com/foo.jpg',
                        amount: 0.1,
                    },
                    {
                        image: 'https://foo.com/bar.png',
                        amount: 0.2,
                    },
                ]}
                    style={{
                        height: '500px',
                    }}
                >
                <div>TECH</div>
                </ParallaxBanner>
                <FirstBlock />


            </>
        )
    }
}
export default Home
